def extract_emails(input_string):
    pattern = '\\b[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\\.[A-Z|a-z]{2,}\\b'
    emails = re.findall(pattern, input_string)
    email_dict = {}
    for email in emails:
        if email not in email_dict:
            email_dict[email] += 1
        else:
            email_dict[email] = 1
    email_json = json.dumps(email_dict)
    return email_json

